import React, { useState } from "react";

const ListCatalogo = () => {
  const [display, setdisplay] = useState(false);

  const hadledisplay = () => setdisplay(!display);

  return (
    <section>
      <ul className="ListCatalogo">
        <li className="ListCatalogoItem" onClick={hadledisplay}> Notebooks </li>
        <div>{display ? <ul><li>la concha tu mai </li><li>la conai </li></ul>  : null}</div>


        <li className="ListCatalogoItem">Procesadores</li>

        <li className="ListCatalogoItem">Mothers</li>
        <li className="ListCatalogoItem">Memorias Ram</li>
        <li className="ListCatalogoItem">Almacenamiento</li>
        <li className="ListCatalogoItem">Placas de Video </li>
        <li className="ListCatalogoItem">Gabinetes, fuentes y coolers</li>
        <li className="ListCatalogoItem">Monitores</li>
        <li className="ListCatalogoItem">Teclados y mouses</li>
        <li className="ListCatalogoItem">
          Audio, parlantes, auriculares y mic </li>
        <li className="ListCatalogoItem">Software</li>
      </ul>

      <div>{display ? <p> procesador</p> : null}</div>
    </section>
  );
};

export default ListCatalogo;
